import React from 'react';
import { Nav } from 'react-bootstrap';
import styled from 'styled-components';

const StyledNav = styled(Nav)`
  background-color: #8a2be2;
`;

const Header = () => (
  <>
    <Nav>
      <Nav.Item>
        <Nav.Link href="/home">Home</Nav.Link>
      </Nav.Item>
    </Nav>
  </>
);

export default Header;
